https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BB%D0%BE%D0%B3\" title=\"\u041d\u0430\u043b\u043e\u0433\">\u043d\u0430\u043b\u043e\u0433\u0438<\/a>. \u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u043d\u044b\u0435 \u043f\u043e\u0442\u043e\u043c\u043a\u0438 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b\u0438 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u043b\u0435\u0434\u0438 \u0413\u043e\u0434\u0438\u0432\u0435 \u0438 \u043e\u0442\u043c\u0435\u0447\u0430\u044e\u0442 \u044d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u043a\u0430\u043a \u043f\u0440\u0430\u0437\u0434\u043d\u0438\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1499_%D0%B3%D0%BE%D0%B4\" title=\"1499 \u0433\u043e\u0434\">1499<\/a>&#160;\u2014 \u043a\u043e\u0440\u0430\u0431\u043b\u044c \u00ab\u0411\u0435\u0440\u0440\u0438\u0443\u00bb \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%83_%D0%9A%D0%BE%D1%8D%D0%BB%D1%8C%D0%BE\" class=\"mw-redirect\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0443 \u041a\u043e\u044d\u043b\u044c\u043e\">\u041d\u0438\u043a\u043e\u043b\u0430\u0443 \u041a\u0443\u044d\u043b\u044c\u044e<\/a> \u0438\u0437 \u0444\u043b\u043e\u0442\u0438\u043b\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%81%D0%BA%D0%BE_%D0%B4%D0%B0_%D0%93%D0%B0%D0%BC%D0%B0\" title=\"\u0412\u0430\u0441\u043a\u043e \u0434\u0430 \u0413\u0430\u043c\u0430\">\u0412\u0430\u0441\u043a\u043e \u0434\u0430 \u0413\u0430\u043c\u0430<\/a>, \u043e\u0442\u043a\u0440\u044b\u0432\u0448\u0435\u0439 \u043c\u043e\u0440\u0441\u043a\u043e\u0439 \u043f\u0443\u0442\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0418\u043d\u0434\u0438\u044e<\/a>, \u043f\u0435\u0440\u0432\u044b\u043c \u0432\u043e\u0437\u0432\u0440\u0430\u0442\u0438\u043b\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%81%D1%81%D0%B0%D0%B1%D0%BE%D0%BD\" title=\"\u041b\u0438\u0441\u0441\u0430\u0431\u043e\u043d\">\u041b\u0438\u0441\u0441\u0430\u0431\u043e\u043d<\/a> \u0441\u043f\u0443\u0441\u0442\u044f \u0434\u0432\u0430 \u0433\u043e\u0434\u0430 \u043f\u043e\u0441\u043b\u0435 \u043d\u0430\u0447\u0430\u043b\u0430 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438. \u0414\u0430 \u0413\u0430\u043c\u0430 \u043d\u0430 \u00ab\u0421\u0430\u043d-\u0413\u0430\u0431\u0440\u0438\u044d\u043b\u0435\u00bb \u0440\u0430\u0437\u043b\u0443\u0447\u0438\u043b\u0441\u044f \u0441 \u00ab\u0411\u0435\u0440\u0440\u0438\u0443\u00bb \u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B1%D0%BE-%D0%92%D0%B5%D1%80%D0%B4%D0%B5\" title=\"\u041a\u0430\u0431\u043e-\u0412\u0435\u0440\u0434\u0435\">\u043e\u0441\u0442\u0440\u043e\u0432\u043e\u0432 \u0417\u0435\u043b\u0451\u043d\u043e\u0433\u043e \u041c\u044b\u0441\u0430<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0448\u0442\u043e\u0440\u043c\u0430 \u0438 \u043f\u0440\u0438\u0431\u044b\u043b \u043d\u0430 \u0440\u043e\u0434\u0438\u043d\u0443 \u0432 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1547_%D0%B3%D0%BE%D0%B4\" title=\"1547 \u0433\u043e\u0434\">1547<\/a>&#160;\u2014 \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u044f\u044f \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u0440\u0430\u0437\u0440\u0435\u0448\u0451\u043d\u043d\u0430\u044f \u043a\u043e\u0440\u043e\u043b\u0451\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%83%D1%8D%D0%BB%D1%8C\" title=\"\u0414\u0443\u044d\u043b\u044c\">\u0434\u0443\u044d\u043b\u044c<\/a>. \u041f\u0440\u0438\u0447\u0438\u043d\u043e\u0439 \u0434\u0430\u043b\u044c\u043d\u0435\u0439\u0448\u0435\u0433\u043e \u0437\u0430\u043f\u0440\u0435\u0442\u0430 \u0434\u0443\u044d\u043b\u0435\u0439 \u0431\u044b\u043b\u0438 \u0447\u0430\u0441\u0442\u044b\u0435 \u0441\u043c\u0435\u0440\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0441\u043b\u0443\u0447\u0430\u0438. \u041d\u0435\u0441\u043c\u043e\u0442\u0440\u044f \u043d\u0430 \u0437\u0430\u043f\u0440\u0435\u0442, \u0434\u0443\u044d\u043b\u0438 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u043b\u0438\u0441\u044c \u0441\u0442\u043e\u043b\u044c \u0436\u0435 \u0447\u0430\u0441\u0442\u043e, \u043a\u0430\u043a \u0438 \u043f\u0440\u0435\u0436\u0434\u0435. \u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1566_%D0%B3%D0%BE%D0%B4\" title=\"1566 \u0433\u043e\u0434\">1566 \u0433\u043e\u0434\u0443<\/a> \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_IX_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b IX (\u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438)\">\u041a\u0430\u0440\u043b IX<\/a> \u0431\u044b\u043b \u0432\u044b\u043d\u0443\u0436\u0434\u0435\u043d \u0438\u0437\u0434\u0430\u0442\u044c \u0443\u043a\u0430\u0437, \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%B5%D1%80%D1%82%D0%BD%D0%B0%D1%8F_%D0%BA%D0%B0%D0%B7%D0%BD%D1%8C\" title=\"\u0421\u043c\u0435\u0440\u0442\u043d\u0430\u044f \u043a\u0430\u0437\u043d\u044c\">\u0441\u043c\u0435\u0440\u0442\u043d\u043e\u0439 \u043a\u0430\u0437\u043d\u0438<\/a> \u043f\u0440\u0438\u0433\u043e\u0432\u0430\u0440\u0438\u0432\u0430\u043b\u0441\u044f \u043b\u044e\u0431\u043e\u0439 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a \u0434\u0443\u044d\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1609_%D0%B3%D0%BE%D0%B4\" title=\"1609 \u0433\u043e\u0434\">1609<\/a>&#160;\u2014 \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0435 \u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043a\u043d\u044f\u0437\u044c\u044f \u0441\u043e\u0437\u0434\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B8%D0%B3%D0%B0_(1609)\" title=\"\u041a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043b\u0438\u0433\u0430 (1609)\">\u041a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u043b\u0438\u0433\u0443<\/a> \u0434\u043b\u044f \u0431\u043e\u0440\u044c\u0431\u044b \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%84%D0%BE%D1%80%D0%BC%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0420\u0435\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f\">\u0420\u0435\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1712_%D0%B3%D0%BE%D0%B4\" title=\"1712 \u0433\u043e\u0434\">1712<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0437\u0430\u043b\u043e\u0436\u0435\u043d \u043a\u0430\u043c\u0435\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80\" title=\"\u041f\u0435\u0442\u0440\u043e\u043f\u0430\u0432\u043b\u043e\u0432\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440\">\u041f\u0435\u0442\u0440\u043e\u043f\u0430\u0432\u043b\u043e\u0432\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1790_%D0%B3%D0%BE%D0%B4\" title=\"1790 \u0433\u043e\u0434\">1790<\/a>&#160;\u2014 \u043f\u0440\