=\"1890 \u0433\u043e\u0434\">1890<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%B9%D0%BE%D0%BC%D0%B8%D0%BD%D0%B3\" title=\"\u0412\u0430\u0439\u043e\u043c\u0438\u043d\u0433\">\u0412\u0430\u0439\u043e\u043c\u0438\u043d\u0433<\/a> \u0441\u0442\u0430\u043b 44 \u0448\u0442\u0430\u0442\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908_%D0%B3%D0%BE%D0%B4\" title=\"1908 \u0433\u043e\u0434\">1908<\/a>&#160;\u2014 \u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0439 \u0444\u0438\u0437\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BC%D0%B5%D1%80%D0%BB%D0%B8%D0%BD%D0%B3-%D0%9E%D0%BD%D0%BD%D0%B5%D1%81,_%D0%A5%D0%B5%D0%B9%D0%BA%D0%B5\" title=\"\u041a\u0430\u043c\u0435\u0440\u043b\u0438\u043d\u0433-\u041e\u043d\u043d\u0435\u0441, \u0425\u0435\u0439\u043a\u0435\">\u0425\u0435\u0439\u043a\u0435 \u041a\u0430\u043c\u0435\u0440\u043b\u0438\u043d\u0433-\u041e\u043d\u043d\u0435\u0441<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043c\u0438\u0440\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B8%D0%B4%D0%BA%D0%B8%D0%B9_%D0%B3%D0%B5%D0%BB%D0%B8%D0%B9\" title=\"\u0416\u0438\u0434\u043a\u0438\u0439 \u0433\u0435\u043b\u0438\u0439\">\u0436\u0438\u0434\u043a\u0438\u0439 \u0433\u0435\u043b\u0438\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u043d\u0430 V \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u043c \u0441\u044