u0430\u043d\">\u0412\u0430\u0442\u0438\u043a\u0430\u043d<\/a> \u0432\u044b\u0441\u0442\u0443\u043f\u0438\u043b \u0441 \u0437\u0430\u044f\u0432\u043b\u0435\u043d\u0438\u0435\u043c, \u0447\u0442\u043e \u0441\u0435\u043c\u044c \u0436\u0435\u043d\u0449\u0438\u043d-\u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a\u043e\u0432, \u0432\u043e\u0437\u0432\u0435\u0434\u0451\u043d\u043d\u044b\u0445 \u0432 \u0441\u0430\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u0438<\/a> \u043c\u0435\u0441\u044f\u0446 \u043d\u0430\u0437\u0430\u0434, \u0434\u043e\u043b\u0436\u043d\u044b \u043f\u0440\u0438\u0437\u043d\u0430\u0442\u044c \u0432\u0441\u044e \u043d\u0435\u043b\u0435\u043f\u043e\u0441\u0442\u044c \u044d\u0442\u043e\u0439 \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u0438. \u0426\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u044e \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u043b \u043d\u0435 \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u043d\u044b\u0439 \u043f\u0430\u043f\u0441\u043a\u0438\u043c \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u043e\u043c \u0430\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u0441\u043a\u0438\u0439 \u0435\u043f\u0438\u0441\u043a\u043e\u043f \u0420\u043e\u043c\u0443\u043b \u0411\u0440\u0430\u0448\u0438.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2011_%D0%B3%D0%BE%D0%B4\" title=\"2011 \u0433\u043e\u0434\">2011<\/a>&#160;\u2014 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D0%B3%D0%B0\" title=\"\u0412\u043e\u043b\u0433\u0430\">\u0412\u043e\u043b\u0433\u0435<\/a> \u0437\u0430\u0442\u043e\u043d\u0443\u043b \u0442\u0435\u043f\u043b\u043e\u0445\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F_(%D1%82%D0%B5%D0%BF%D0%BB%D0%BE%D1%85%D0%BE%D0%B4)\" class=\"mw-redirect\" title=\"\u0411\u0443\u043b\u0433\u0430\u0440\u04